import Logo from "../logo/Logo";
import '../title/Title.css';
import styled from 'styled-components';

const TitleText = styled.h1`
font-size: 40em;
text-align: center;
color: dark-gray;
font-family: SpaceMonoBold;
font-weight: 600;
`

export default function Title() {
  return (
    <div>
      <Logo/>
      <TitleText>PANACEA</TitleText>
    </div>
  );
}
